LocaleInfo.ui_metadata_aggregation_dashboard_DashboardAttributePane_defaultFilterConditionScriptComment = "It is GroovyScript to specify the conditions to be set by default in the dashboard initial display.<BR />InitCondMap (Map&lt;String, String&gt;) is bound as a variable.<BR />Value is set as the initial condition by setting the value in the form of \"key: condition name (see below), value: value to the initial condition (string) \" to initCondMap in this script.<BR /><BR/>As bind variables, \"user: User Information\", \"request: Request information\", \"session: session information\" is bound in advance.<BR/>If the following condition is specified in the request parameters, it is set to initCondMap in advance.<BR /><BR/>Conditions that can be set is as follows.<div style=\"width:500px; height:330px; overflow:auto; border:1px solid #000000\">xxx is property name (property defined name of the filter setting), y is index (specify more than one of the same item, specify from 0).<br /><ul style=\"padding-left: 20px;\"><li>doFilterAggregation: Apply a filter condition when the display when the true, the aggregates without applying a filter condition otherwise.</li><li>xxxConditionCount: The number for specifying multiple conditions in the same field</li><li>xxx_ope_y: Specifies the comparison operator.*1</li><li>xxx_y: Specify the value of the filter.*2</li><li>xxx_to_y: Specify the value of the end of the range comparison operator of \"RG\" is selected.*2</li><li>xxx_in_y: Specify the value of the comparison operator \"IN\" is selected. You must be separated by commas if there is more than one.*2</li><li>xxx_dateRange_y: Specify a value comparison operator \"RD\" and \"RDT\" is selected.*3</li><li>xxx_savedList_y: Specify the value comparison operators \"SL\" is selected.*4</li><li>xxx_compareAsString_y: Specifies whether to compare as string comparison operator to \"SL\" is selected.*4</li></ul><h4>*1 Can be specified comparison operator</h4><ul style=\"padding-left: 20px;\"><li>EQ: Equals</li><li>NE: Not Equals</li><li>SW: Forward match</li><li>LW: Backward match</li><li>IC: Include</li><li>NIC: Not Include</li><li>IN: In</li><li>LT: Less Than</li><li>GT: Greater Than</li><li>LE: Less or Equals</li><li>GE: Greater or Equals</li><li>RG: Range</li><li>RD: Range Date</li><li>RDT Range Datetime</li><li>NNL: Is Not Null</li><li>NL: Is Null</li><li>SL: Saved List</li></ul><h4>*2 The format of the value</h4><ul style=\"padding-left: 20px;\"><li>Boolean: true or false</li><li>Date: yyyyMMdd</li><li>Datetime: yyyyMMddHHmmss</li><li>Reference: OID of entity</li><li>Select: value of SelectValue</li><li>Time: HHmmss</li></ul><h4>*3 For the set value of the relative range</h4><ul style=\"padding-left: 20px;\"><li>LAST_MONTH: Last Month</li><li>THIS_MONTH: This Month</li><li>NEXT_MONTH: Next Month</li><li>LAST_WEEK: Last Week</li><li>THIS_WEEK: This Week</li><li>NEXT_WEEK: Next Week</li><li>YESTERDAY: Yesterday</li><li>TODAY: Today</li><li>TOMORROW: Tomorrow</li><li>LAST_7_DAYS: Last 7 days</li><li>LAST_30_DAYS: Last 30 days</li><li>NEXT_7_DAYS: Next 7 days</li><li>NEXT_30_DAYS: Next 30 days</li></ul><h4>*4 For the set value from the Saved List</h4>Specified in the form of \"OID of the Saved List: Column number\".<br />If you want to compare as a string, you can specify true to compareAsString.</div>";
