LocaleInfo.ui_metadata_command_config_CommandConfigEditDialog_transactionPropagation = "Set Propagation of transaction when executing this Command instance.<ul><li>REQUIRED: Start (and commit / roll back) if the transaction has not been started. If a transaction has already been started, it is executed in the context of that transaction.</li><li>REQUIRES_NEW: Start a new transaction (and commit / roll back). If there is an existing transaction, it is temporarily suspended and resumed after completion of the processing.</li><li>NOT_SUPPORTED: Do not control transactions. If an existing transaction is started, the transaction is temporarily suspended and resumed after completion of the processing.</li><li>SUPPORTS: If the transaction has not been started, do not control the transaction. If the transaction has already been started, it is executed in the context of that transaction.</li></ul>";
