LocaleInfo.generic_common_WebApiAutocompletionSetting_eqlDescriptionKey = "This is the process to be executed when EQL is selected with auto completion type.<br>Please write in GroovyTemplate format.<br><br>If the target item is Reference type, return the array of Entity.<br>Be sure to specify oid and name for EQL<br><br>In cases other than Reference type, the first Select item is used as the completion value.<br><br>Available variables are bound with the following names.<br><br>user\t: UserBinding ... user information<br>params\t: Map<String, String[]> ... The value of the property of the linkage source<br><br>The types that can be auto-complemented and the types of return values are as follows.<br>Binary type\t: String(search condition only)<br>Boolean type\t: boolean, String(true/false)<br>Date type\t: Date, String(yyyyMMdd)<br>Datetime type\t: Timestamp, String(yyyyMMddhhmmssSSS)<br>Decimal type\t: Bigdecimal, String<br>Float type\t: Double, String<br>Integer type\t: Long, String<br>LongText type\t: String<br>Reference type\t: Entity(oid, name is required)<br>Select type\t: SelectValue, String(value)<br>String type\t: String<br>Time type\t: Time, String(hhmmssSSS)";
